const QRCode = require('qrcode');
const { createCanvas, loadImage } = require('canvas');

async function create(dataForQRcode, center_image, width, cwidth) {
  const canvas = createCanvas(width, width);
  QRCode.toCanvas(canvas, dataForQRcode, {
    errorCorrectionLevel: 'H',
    margin: 1,
    color: {
      dark: '#000000',
      light: '#ffffff'
    }
  });

  const ctx = canvas.getContext('2d');
  const img = await loadImage(center_image);
  const center = width / 2 - 10;
  ctx.drawImage(img, center, center, cwidth, cwidth);
  return canvas.toDataURL('image/png');
}

/**
 * Generates QRCode of a plain text
 * @param {string} text plain text in sting
 * @returns dataurl which can be plased inside of </img> tag
 */
module.exports = function (data) {
  return new Promise((resolve, reject) => {
    try {
      create(
        data,
        'data:image/png;base64,',
        150,
        50
      ).then((qrCode) => {
        return resolve(qrCode.replace('data:image/png;base64,', ''));
      });
    } catch (error) {
      return reject(error);
    }
  });
};

